Now tests if code works with objects.

Incorrect code like the following will not work since it can't handle objects.

``` javascript
function steamroller(arr) {
  arr = arr.toString().split(',');

  for (var i = 0; i < arr.length; i++) {

    test = parseInt(arr[i], 10);

    if ( !isNaN(test) ) {  // if test not is not a num
      arr[i] = test;

    } else if (arr[i] === '') { // Object is '' after .toString(), so remove empty strings

      arr.splice(i, 1);
      i--;
    }
  }

  return arr;
}
```

Challenge: http://www.freecodecamp.com/challenges/bonfire-diff-two-arrays

Adds checks for duplicate elements in arrays.

The following code passes even if it's not correct.

``` js
function diff(arr1, arr2) {
  return (arr1.length == 0 ? arr2 : arr1.concat(arr2).filter(function(val,el,a){
     return (a.indexOf(val) == a.lastIndexOf(val));
  }));
}
```

