This is my attempt to fix loop-protect triggering in comment styled like 
`/* comment */`

this was occurring because loop protects function for checking multi-line comments ignores the line that the keyword, such as "for" was found on. I edited the function so that if an opening /\* and a closing */ were found on the same line. it will recognize that as a complete comment.

All tests are passing on my local machine. and the code in the issue now runs as expected

```
function palindrome(str) {

  //have to remove all non-alphanumeric characters - punctuation, spaces, symbols. Assume you have to use regular expressions for this. 
  var stripWord = str.replace(/\W|\s|_/g,'');

  //set all words to lowercase
  var palinWord = stripWord.toLowerCase(); 
  console.log(palinWord); 


    /* reverse palinWord for comparison*/
  var checkPalindrome = palinWord.split('').reverse().join('');
  console.log(checkPalindrome); 

   /* Check to see if str is a Palindrome */
   if (palinWord === checkPalindrome) {
     return true;
   } else {
     return false; 
   }



}



palindrome("A man, a plan, a canal. Panama");
```

Closes #6230. Tested locally.
This was an interesting issue. I've tried to reproduce and here is what I've got in my console:
![](http://i.imgur.com/PhrD1r0.png)
Here you can see that I'm redirected to the last place I've been, which is `/map-aside` (but `/map-aside` actually isn't where we want to be redirected). Then I searched `freecc:user:remote` in the entire codebase and one of the matches was in `common/models/user.js`. Then I searched `user logged in` and [found this](https://github.com/FreeCodeCamp/FreeCodeCamp/blob/staging/common/models/user.js#L175-L187):

``` js
return req.logIn({ id: accessToken.userId.toString() }, function(err) {
  if (err) { return next(err); }

  debug('user logged in');

  if (req.session && req.session.returnTo) {
    return res.redirect(req.session.returnTo);
  }

  req.flash('success', { msg: 'Success! You are logged in.' });
  return res.redirect('/');
});
```

As you can see here we're getting redirected to `req.session.returnTo`. By using `debug` funcs I've found out that:
![](http://i.imgur.com/PZRPbKT.png)
 `req.session.returnTo` actually is `/map-aside` and that is why I was redirected to `/map-aside`.

**UPD.**
Made a similar fix in [`server/middlewares/add-return-to.js`](https://github.com/FreeCodeCamp/FreeCodeCamp/blob/staging/server/middlewares/add-return-to.js#L39) so now this works not only for email login but for GitHub login too.

If the code does not have a newline at the end and ends with a comment, then the first line of the tail will be cut off and will occasionally not evaluate correctly when calling eval(code).

For example:
var secondTree = myPlants[1].list[2]; // Change this line(function(x) {
  if (typeof x != 'undefined') {
    return "secondTree = " + x;
  }
  return "secondTree is undefined";
})(secondTree);

The function declaration after '// Change this line' will be cut off and the return statements below will throw an error. A newline before the tail prevents this from occurring. 

